import React from 'react';

const Navbar = () => {
  return (
    <nav className="navbar navbar-dark sticky-top bg-dark flex-md-nowrap p-2 shadow">
      <a className="navbar-brand col-md-3 col-lg-2 mr-0 px-3" href="#">Mi Dashboard</a>
    </nav>
  );
};

export default Navbar;
